INSERT INTO `qs_pms` VALUES ('29783','1','','0','64306','奥派瑞科技','所有注册企业请上传营业执照\r\n本着对网站求职者的负责，同时增加网站企业会员发布信息的公信力，网站设置会员注册后，必须上传营业执照，通过企业审核，方可发布招聘信息，否则发布信息一律无法显示。\r\n\r\n为什么要上传营业执照： ① 通过认证后您将获得更多权限；\r\n② 通过认证后可额外获得积分；\r\n③ 通过认证后可增加信息的可信度，成为已认证企业；\r\n注：上传营业执照仅供我们审核，绝不会用任何形式对外公开。','1435895522','1','1435895522','0');
INSERT INTO `qs_pms` VALUES ('29784','1','','0','64307','郑州优硕科技','所有注册企业请上传营业执照\r\n本着对网站求职者的负责，同时增加网站企业会员发布信息的公信力，网站设置会员注册后，必须上传营业执照，通过企业审核，方可发布招聘信息，否则发布信息一律无法显示。\r\n\r\n为什么要上传营业执照： ① 通过认证后您将获得更多权限；\r\n② 通过认证后可额外获得积分；\r\n③ 通过认证后可增加信息的可信度，成为已认证企业；\r\n注：上传营业执照仅供我们审核，绝不会用任何形式对外公开。','1435895524','1','1435895524','0');
